Defendant Kristin Elizabeth Engler in court with attorney Patrick Thomas Earle.  Sara Nicole Volden Schroeder appeared for the State of Wisconsin.  Sentencing proceeded.  Statements by the State, defense and defendant.    The Court imposed the following sentence:   The Defendant's TOTAL LENGTH OF SENTENCE shall be 5 years.  Defendant's TERM OF CONFINEMENT in the Wisconsin Prison System shall be for 2-1/2 years  with credit for 15 days time served.  Defendant shall serve 2-1/2 years on EXTENDED SUPERVISION.  The defendant IS eligible for the Challenge Incarceration Program and for  the Wisconsin Substance Abuse Program.  The Court advised the defendant of her determinate sentence pursuant to statute and in accordance with Form CR-234.  Copy provided to defendant.   The Court STAYED THE SENTENCE and placed the defendant on probation to the State Department of Corrections for a period of four (4) years.
 * Court ordered defendant to provide a DNA sample.

 CONDITIONS OF PROBATION (and Extended Supervision, if revoked):
 - The Court imposed 12 months condition time:  9 months to be served by defendant with Huber for work and release to the Day Reporting Center.  Court stayed report date to 5:00 p.m. on 7/27/15.  The balance of 90 days was stayed to be used at the discretion of the agent for any sanctions.  In the alternative, if defendant is non-compliant, the Court ordered revocation of defendant's probation in lieu of the 90 days condition time.
 - No contact with Seema V.;
 - No contact with the Mobil Gas Station at 6611 South 27th Street, city of Franklin, county of Milwaukee, Wisconsin;
 - Undergo a mental health evaluation; follow any treatment recommended;
 - No controlled substances other than those legally prescribed for defendant by a duly licensed physician for her mental or physical needs; take only as prescribed and only for as long as deemed medically reasonable and necessary;
 - No alcohol;
 - AODA assessment; treatment, if needed;
 - Urine screens to ensure compliance;
 - Seek and maintain employment;
 - Be given job and vocational training;
 - Cognitive thinking intervention counseling;
 - Pay restitution to the Mobile Gas Station in the stipulated amount of $650.00.  CASH BAIL ON DEPOSIT TO APPLY.  Court ordered the defendant to pay the DNA surcharge, costs and disbursements; CASH BAIL ON DEPOSIT TO APPLY. 

